/// Sorts the elements of `arr` in-place using radix sort.
///
/// Time complexity is `O((n + b) * logb(k))`, where `n` is the number of elements,
/// `b` is the base (the radix), and `k` is the largest element.
/// When `n` and `b` are roughly the same maginitude, this algorithm runs in linear time.
///
/// Space complexity is `O(n + b)`.
pub fn radix_sort(arr: &mut [u64]) { let max: usize = match arr.iter().max() { Some(&x) => x as usize, None => return, }; // Make radix a power of 2 close to arr.len() for optimal runtime let radix = arr.len().next_power_of_two(); // Counting sort by each digit from least to most significant let mut place = 1; while place <= max { let digit_of = |x| x as usize / place % radix; // Count digit occurrences let mut counter = vec![0; radix]; for &x in arr.iter() { counter[digit_of(x)] += 1; } // Compute last index of each digit for i in 1..radix { counter[i] += counter[i - 1]; } // Write elements to their new indices for &x in arr.to_owned().iter().rev() { counter[digit_of(x)] -= 1; arr[counter[digit_of(x)]] = x; } place *= radix; }
} #[cfg(test)]
mod tests { use super::super::is_sorted; use super::radix_sort; #[test] fn empty() { let mut a: [u64; 0] = []; radix_sort(&mut a); assert!(is_sorted(&a)); } #[test] fn descending() { let mut v = vec![201, 127, 64, 37, 24, 4, 1]; radix_sort(&mut v); assert!(is_sorted(&v)); } #[test] fn ascending() { let mut v = vec![1, 4, 24, 37, 64, 127, 201]; radix_sort(&mut v); assert!(is_sorted(&v)); }
}

