use std::cmp::Ordering; pub fn binary_search_rec<T: Ord>( list_of_items: &[T], target: &T, left: &usize, right: &usize,
) -> Option<usize> { if left >= right { return None; } let middle: usize = left + (right - left) / 2; match target.cmp(&list_of_items[middle]) { Ordering::Less => binary_search_rec(list_of_items, target, left, &middle), Ordering::Greater => binary_search_rec(list_of_items, target, &(middle + 1), right), Ordering::Equal => Some(middle), }
} #[cfg(test)]
