use std::io; //Interactive Tic-Tac-Toe play needs the "rand = "0.8.3" crate.
//#[cfg(not(test))]
//extern crate rand;
//#[cfg(not(test))]
//use rand::Rng; #[derive(Copy, Clone, PartialEq, Debug)]
struct Position { x: u8, y: u8,
} #[derive(Copy, Clone, PartialEq, Debug)]
pub enum Players { Blank, PlayerX, PlayerO,
} #[derive(Copy, Clone, PartialEq, Debug)]
struct SinglePlayAction { position: Position, side: Players,
} #[derive(Clone, PartialEq, Debug)]
pub struct PlayActions { positions: Vec<Position>, side: Players,
