use std::vec::Vec; #[derive(Debug)]
pub struct Edge { source: i64, destination: i64, cost: i64,
} impl PartialEq for Edge { fn eq(&self, other: &Self) -> bool { self.source == other.source && self.destination == other.destination && self.cost == other.cost }
} impl Eq for Edge {} impl Edge { fn new(source: i64, destination: i64, cost: i64) -> Self { Self { source, destination, cost, } }
} fn make_sets(number_of_vertices: i64) -> Vec<i64> { let mut parent: Vec<i64> = Vec::with_capacity(number_of_vertices as usize); for i in 0..number_of_vertices { parent.push(i); } parent
} fn find(parent: &mut Vec<i64>, x: i64) -> i64 { let idx: usize = x as usize; if parent[idx] != x { parent[idx] = find(parent, parent[idx]); } parent[idx]
} fn merge(parent: &mut Vec<i64>, x: i64, y: i64) { let idx_x: usize = find(parent, x) as usize; let parent_y: i64 = find(parent, y); parent[idx_x] = parent_y;
} fn is_same_set(parent: &mut Vec<i64>, x: i64, y: i64) -> bool { find(parent, x) == find(parent, y)
} pub fn kruskal(mut edges: Vec<Edge>, number_of_vertices: i64) -> (i64, Vec<Edge>) { let mut parent: Vec<i64> = make_sets(number_of_vertices); edges.sort_unstable_by(|a, b| a.cost.cmp(&b.cost)); let mut total_cost: i64 = 0; let mut final_edges: Vec<Edge> = Vec::new(); let mut merge_count: i64 = 0; for edge in edges.iter() { if merge_count >= number_of_vertices - 1 { break; } let source: i64 = edge.source; let destination: i64 = edge.destination; if !is_same_set(&mut parent, source, destination) { merge(&mut parent, source, destination); merge_count += 1; let cost: i64 = edge.cost; total_cost += cost; let final_edge: Edge = Edge::new(source, destination, cost); final_edges.push(final_edge); } } (total_cost, final_edges)
} #[cfg(test)]
