pub fn logarithmic_fibonacci(n: u32) -> u128 { // if it is the max value before overflow, use n-1 then get the second // value in the tuple if n == 186 { let (_, second) = _logarithmic_fibonacci(185); second } else { let (first, _) = _logarithmic_fibonacci(n); first }
