/// Sort a slice using bucket sort algorithm.
///
/// Time complexity is `O(n + k)` on average, where `n` is the number of elements,
/// `k` is the number of buckets used in process.
///
/// Space complexity is `O(n + k)`, as it sorts not in-place.
pub fn bucket_sort(arr: &[usize]) -> Vec<usize> { if arr.is_empty() { return vec![]; } let max = *arr.iter().max().unwrap(); let len = arr.len(); let mut buckets = vec![vec![]; len + 1]; for x in arr { buckets[len * *x / max].push(*x); } for bucket in buckets.iter_mut() { super::insertion_sort(bucket); } let mut result = vec![]; for bucket in buckets { for x in bucket { result.push(x); } } result
} #[cfg(test)]
mod tests { use super::super::is_sorted; use super::*; #[test] fn empty() { let arr: [usize; 0] = []; let res = bucket_sort(&arr); assert!(is_sorted(&res)); } #[test] fn one_element() { let arr: [usize; 1] = [4]; let res = bucket_sort(&arr); assert!(is_sorted(&res)); } #[test] fn already_sorted() { let arr: [usize; 3] = [10, 9, 105]; let res = bucket_sort(&arr); assert!(is_sorted(&res)); } #[test] fn basic() { let arr: [usize; 4] = [35, 53, 1, 0]; let res = bucket_sort(&arr); assert!(is_sorted(&res)); } #[test] fn odd_number_of_elements() { let arr: Vec<usize> = vec![1, 21, 5, 11, 58]; let res = bucket_sort(&arr); assert!(is_sorted(&res)); } #[test] fn repeated_elements() { let arr: Vec<usize> = vec![542, 542, 542, 542]; let res = bucket_sort(&arr); assert!(is_sorted(&res)); }
}

