let s0: u32 = ah[0].rotate_right(2) ^ ah[0].rotate_right(13) ^ ah[0].rotate_right(22); let maj: u32 = (ah[0] & ah[1]) ^ (ah[0] & ah[2]) ^ (ah[1] & ah[2]); let temp2: u32 = s0.wrapping_add(maj); ah[7] = ah[6]; ah[6] = ah[5]; ah[5] = ah[4]; ah[4] = ah[3].wrapping_add(temp1); ah[3] = ah[2]; ah[2] = ah[1]; ah[1] = ah[0]; ah[0] = temp1.wrapping_add(temp2); } } for i in 0..8 { h[i] = h[i].wrapping_add(ah[i]); } chunk = [0; 64]; } for i in 0..8 { hash[i * 4] = (h[i] >> 24) as u8; hash[i * 4 + 1] = (h[i] >> 16) as u8; hash[i * 4 + 2] = (h[i] >> 8) as u8; hash[i * 4 + 3] = h[i] as u8; } hash
} fn calc_chunk(chunk: &mut [u8; 64], state: &mut BufState) -> bool { if state.total { return false; } if state.len >= 64 { for x in chunk { *x = state.data[0]; state.data.remove(0); } state.len -= 64; return true; } let remaining: usize = state.data.len(); let space: usize = 64 - remaining; for x in chunk.iter_mut().take(state.data.len()) { *x = state.data[0]; state.data.remove(0); } if !state.single { chunk[remaining] = 0x80; state.single = true; } if space >= 8 { let mut len = state.total_len; chunk[63] = (len << 3) as u8; len >>= 5; for i in 1..8 { chunk[(63 - i)] = len as u8; len >>= 8; } state.total = true; } true
