// Heap data structure
// Takes a closure as a comparator to allow for min-heap, max-heap, and works with custom key functions use std::cmp::Ord;
use std::default::Default; pub struct Heap<T>
where T: Default,
{ count: usize, items: Vec<T>, comparator: fn(&T, &T) -> bool,
} impl<T> Heap<T>
where T: Default,
{ pub fn new(comparator: fn(&T, &T) -> bool) -> Self { Self { count: 0, // Add a default in the first spot to offset indexes // for the parent/child math to work out. // Vecs have to have all the same type so using Default // is a way to add an unused item. items: vec![T::default()], comparator, } } pub fn len(&self) -> usize { self.count } pub fn is_empty(&self) -> bool { self.len() == 0 } pub fn add(&mut self, value: T) { self.count += 1; self.items.push(value); // Heapify Up let mut idx = self.count; while self.parent_idx(idx) > 0 { let pdx = self.parent_idx(idx); if (self.comparator)(&self.items[idx], &self.items[pdx]) { self.items.swap(idx, pdx); } idx = pdx; } } fn parent_idx(&self, idx: usize) -> usize { idx / 2 } fn children_present(&self, idx: usize) -> bool { self.left_child_idx(idx) <= self.count } fn left_child_idx(&self, idx: usize) -> usize { idx * 2 } fn right_child_idx(&self, idx: usize) -> usize { self.left_child_idx(idx) + 1 } fn smallest_child_idx(&self, idx: usize) -> usize { if self.right_child_idx(idx) > self.count { self.left_child_idx(idx) } else { let ldx = self.left_child_idx(idx); let rdx = self.right_child_idx(idx); if (self.comparator)(&self.items[ldx], &self.items[rdx]) { ldx } else { rdx } } }
} impl<T> Heap<T>
where T: Default + Ord,
{ /// Create a new MinHeap pub fn new_min() -> Self { Self::new(|a, b| a < b) } /// Create a new MaxHeap pub fn new_max() -> Self { Self::new(|a, b| a > b) }
} impl<T> Iterator for Heap<T>
where T: Default,
{ type Item = T; fn next(&mut self) -> Option<T> { if self.count == 0 { return None; } // This feels like a function built for heap impl :) // Removes an item at an index and fills in with the last item // of the Vec let next = Some(self.items.swap_remove(1)); self.count -= 1; if self.count > 0 { // Heapify Down let mut idx = 1; while self.children_present(idx) { let cdx = self.smallest_child_idx(idx); if !(self.comparator)(&self.items[idx], &self.items[cdx]) { self.items.swap(idx, cdx); } idx = cdx; } } next }
} pub struct MinHeap; impl MinHeap { #[allow(clippy::new_ret_no_self)] pub fn new<T>() -> Heap<T> where T: Default + Ord, { Heap::new(|a, b| a < b) }
} pub struct MaxHeap; impl MaxHeap { #[allow(clippy::new_ret_no_self)] pub fn new<T>() -> Heap<T> where T: Default + Ord, { Heap::new(|a, b| a > b) }
} #[cfg(test)]
